(25, 4, 'Natal Solid&aacute;rio do SOF', '2015-12-26', 0, '<h3 style=\"\">Natal Solid&aacute;rio do SOF</h3><hr><p style=\"\"><img data-name=\"2c5e8e9901ed71d4146c5c8d81784f9573d5e0d2.png\" class=\"fr-dib fr-draggable\" src=\"../uploads/2c5e8e9901ed71d4146c5c8d81784f9573d5e0d2.png\" style=\"width: 300px;\"></p><p style=\"\">Em dezembro de 2015, a equipe do Setor de Or&ccedil;amento e Finan&ccedil;as doa ventiladores para as crian&ccedil;as do Centro de Desenvolvimento Comunit&aacute;rio Esta&ccedil;&atilde;o dos Ventos.&nbsp;</p><p style=\"\">Para saber como voc&ecirc; pode colaborar, clique <a href=\"http://www.estacaodosventos.com.br/\" target=\"_blank\">aqui</a>!</p><p style=\"\"><br></p>'),
