(40, 4, 'Cadastro Atualizado no SICAF', '2016-05-06', 1, '<h3 style=\"\"><strong>Cadastro Atualizado no SICAF</strong></h3><p style=\"\"><strong><img class=\"fr-dib fr-draggable\" src=\"../uploads/6fd28f42ca45a53a37bc26a6d6fbf74a1d77d3e3.png\" style=\"width: 539px;\"></strong><br></p>'),
(41, 4, 'SOF no Projeto Catalunha', '2015-06-01', 1, '<h3><strong>SOF no Projeto Catalunha</strong></h3><p><img class=\"fr-dib fr-draggable\" src=\"../uploads/3573a3ec1b1efce0be34689527b83b007f584d6d.png\" style=\"width: 539px;\"></p><p>Entre 25 e 29 de maio, em Natal - RN, o SOF participou &nbsp;do &ldquo;<em>Compartilhamento de experi&ecirc;ncias e desenvolvimento de mecanismos e instrumentos para o aprimoramento da gest&atilde;o econ&ocirc;mico-financeira dos Hospitais Universit&aacute;rios Federais (HUF)&rdquo;,&nbsp;</em>uma parceria entre a EBSERH e o Cons&oacute;rcio Hospitalar da Catalunha/Espanha.</p><p>Tamb&eacute;m participaram do encontro os hospitais HUOL-UFRN e o HU-UFMA.&nbsp;</p><p><br></p>'),
(42, 4, 'Curso de Capacita&ccedil;&atilde;o para a Equipe do SOF', '2016-05-10', 1, '<h3 style=\"\"><strong>Curso de Capacita&ccedil;&atilde;o para a Equipe do SOF</strong></h3><p style=\"\"><img class=\"fr-dib fr-draggable\" src=\"../uploads/8aeb2fb67030e254d396b010dc8492e29183f788.jpg\" style=\"width: 539px;\"></p><p style=\"\">No dia 10 de maio ocorreu o I Curso de Capacita&ccedil;&atilde;o para a Equipe do SOF ministrado pela Contadora Greice Eccel Pontelli que atua como T&eacute;cnica em Contabilidade no Setor de Avalia&ccedil;&atilde;o e Controladoria do HUSM.&nbsp;</p><p style=\"\">O treinamento teve como objetivo capacitar a equipe do Setor de Or&ccedil;amento e Finan&ccedil;as no que diz respeito &agrave;s Funcionalidades do Portal de Compras Governamentais.</p><p style=\"\"><img class=\"fr-dib fr-draggable\" src=\"../uploads/d7ddad8e65a37db4cbcefbb3ae85a16ec0025742.jpg\" style=\"width: 539px;\"></p><p style=\"\"><br></p><p style=\"\"><br></p>'),
(43, 6, 'Emiss&atilde;o de GRU', '2016-08-04', 1, '<h3 style=\"\">Emiss&atilde;o de GRU</h3><hr><p style=\"\">Ap&oacute;s o pagamento, enviar c&oacute;pia do comprovante de pagamento e da GRU para o <a href=\"https://sofhusm.net.br/view/faleconosco.php\" target=\"_blank\">e-mail do SOF</a>.</p><p style=\"\"><br></p><p style=\"\"><span class=\"fr-video fr-dvb fr-draggable\" contenteditable=\"false\" draggable=\"true\"><iframe src=\"//www.youtube.com/embed/Hx4bw0CWnFQ\" allowfullscreen=\"\" width=\"640\" height=\"360\" frameborder=\"0\"></iframe></span>\r\n</p>'),
(44, 3, 'Nova Not&iacute;cia', '2016-07-23', 0, '<h3 style=\"\">Nova Not&iacute;cia</h3><hr><p style=\"\">Dessa vez, muito mais segura!</p><p style=\"\">Essa not&iacute;cia ser&aacute; usada para testes.</p><p style=\"\"><br></p><p style=\"\">Ela foi editada aqui.</p><p style=\"\"><br></p><p style=\"\">Mudando de p&aacute;gina.</p><p style=\"\"><br></p><p style=\"\">Excluindo.</p>'),
(45, 5, '', '2017-11-09', 0, '<p style=\"\"><img class=\"fr-dib fr-draggable\" src=\"../uploads/2c4c00a104b0c978c4a574bd0e379ee56a92546d.jpg\" style=\"width: 463px;\"></p>'),
(46, 7, 'Agradecimentos', '2018-02-02', 1, '<h3 style=\"\">Agradecimentos</h3><p style=\"\">Na inten&ccedil;&atilde;o de agradecer &agrave; toda a equipe do Setor de Or&ccedil;amento e Finan&ccedil;as do HUSM pelo reconhecimento de um trabalho repleto de dedica&ccedil;&atilde;o e carinho, manifesto aqui minha sincera gratid&atilde;o &agrave;queles que estiveram e &agrave;queles que continuam trabalhando no SOF.</p><p style=\"\">Considerando que nosso Setor foi/&eacute; constitu&iacute;do de bolsistas, terceirizados, empregados p&uacute;blicos e funcion&aacute;rios estatut&aacute;rios, registro que somos, hoje, a figura da contribui&ccedil;&atilde;o de cada uma dessas pessoas indistintamente. &nbsp;Ainda que muitas delas j&aacute; n&atilde;o estejam mais conosco.</p><p style=\"\">Reitero meu agradecimento e carinho pelos depoimentos a mim dedicados, mas reconhe&ccedil;o que minha postura &eacute; apenas o reflexo da efici&ecirc;ncia, do comprometimento e do profissionalismo de cada um de voc&ecirc;s....&nbsp;</p><p style=\"\">N&atilde;o poderia deixar de agradecer ao Departamento de Contabilidade e Finan&ccedil;as &nbsp;da UFSM, &nbsp;onde encontrei mestres competentes e seres humanos maravilhosos que contribu&iacute;ram para o meu aprendizado e crescimento profissional.... Agrade&ccedil;o, tamb&eacute;m, aos membros da PROPLAN, da UFSM, por compartilharem suas experi&ecirc;ncias e conhecimento comigo... Minha gratid&atilde;o eterna a todos!</p><p style=\"\">Por fim, dedico o reconhecimento dispensado ao SOF a todos os pacientes do HUSM, &agrave; Divis&atilde;o Administrativa Financeira, &agrave; Gerencia Administrativa e &agrave; Superintend&ecirc;ncia que representa todos os profissionais extremamente comprometidos com o nosso Hospital, independentemente de suas &aacute;reas de atua&ccedil;&atilde;o.&nbsp;</p><p style=\"\">Iara Ribeiro</p><p style=\"\">Chefe do Setor de Or&ccedil;amento e Finan&ccedil;as do HUSM</p><p style=\"\"><br></p><hr><p style=\"\"><span style=\"font-family: Tahoma,Geneva,sans-serif;\"><span style=\"font-size: 18px;\"><strong>Depoimentos</strong></span></span></p><p style=\"\"><br></p><p style=\"\">1) &quot;Iara .... Falo, sem medo de errar, que foi no SOF que me senti &uacute;til, respeitado e valorizado enquanto profissional e ser humano. Quando escolhi a contabilidade, isso l&aacute; no in&iacute;cio deste novo s&eacute;culo, vi de cara que teria pela frente um servi&ccedil;o ma&ccedil;ante, por vezes duro e pouco reconhecido. Sendo assim, h&aacute; que se ter um ambiente de trabalho que equilibre, que promova um contraponto, que d&ecirc; o m&iacute;nimo de leveza a quem carrega uma responsabilidade imensa: a de ajudar a levar adiante um pedacinho do seu pa&iacute;s. A contabilidade p&uacute;blica &eacute; coisa s&eacute;ria, e fico feliz em ter tido contato com ela em um ambiente que me proporcionou a m&iacute;nima tranquilidade necess&aacute;ria. Foi no SOF que pude ver na pr&aacute;tica o que &eacute; um trabalho em equipe. Tu sempre cuidaste do teu time, sempre incentivaste cada um em cada momento dif&iacute;cil, e sempre nos fez acreditar que &eacute;ramos importantes, necess&aacute;rios e, acima de tudo, que est&aacute;vamos juntos.</p><p style=\"\">Respeito e admira&ccedil;&atilde;o n&atilde;o se encontra em balc&otilde;es de mercado ou em prateleiras de farm&aacute;cias; se conquista pura e simplesmente pelo que se &eacute;, pela maneira que se age, pelo olho no olho, pela palavra franca, pelo &ldquo;pux&atilde;o de orelha&rdquo; que visa n&atilde;o apenas apontar o erro, mas estender a m&atilde;o e ajudar a encontrar um caminho, uma solu&ccedil;&atilde;o.</p><p>O tempo em que estive sob o teu comando, ou sob tua dire&ccedil;&atilde;o, ou seja l&aacute; o nome que se d&ecirc;, foi um tempo de incr&iacute;vel aprendizado das coisas que mais valem nessa vida; chefes nos d&atilde;o li&ccedil;&otilde;es t&eacute;cnicas, te&oacute;ricas, pr&aacute;ticas e rotineiras important&iacute;ssimas. L&iacute;deres, aprendem conosco tanto quanto e ao mesmo tempo que nos ensinam. Na maioria das vezes, os l&iacute;deres nem sabem que est&atilde;o ensinando, mas a gente sabe exatamente o que e porqu&ecirc; est&aacute; aprendendo.</p><p>E isso, te digo por experi&ecirc;ncia pr&oacute;pria, a gente carrega para toda a vida. Desde que mudei para Porto Alegre at&eacute; hoje, nos dias dif&iacute;ceis busco as lembran&ccedil;as de tudo o que aprendi todos os dias com a tua conduta, com tua retid&atilde;o, com tua generosidade, com tua firmeza e com teu car&aacute;ter. A equipe com a qual eu tive a honra de trabalhar no HUSM &eacute; maravilhosa pelo que cada um &eacute;, e pelo o que tu nos ensinou a ser.</p><p style=\"\">Enfim, &eacute; por essas e outras que sempre que passo em Santa Maria n&atilde;o hesito em chegar para um abra&ccedil;o, um sorriso, e, principalmente, para olhar nos teus olhos e dizer: Iara, muito obrigado!!! &quot; (Anderson Mireski, &nbsp; servidor da UFRGS)</p><hr><p style=\"\">2) &nbsp;&ldquo;Meu nome &eacute; Camila Kegler e fui empregada p&uacute;blica da Empresa Brasileira de Servi&ccedil;os Hospitalares, no Hospital Universit&aacute;rio de Santa Maria (HUSM), entre setembro de 2014 e julho de 2016. Tive o privil&eacute;gio de trabalhar no Setor de Or&ccedil;amento e Finan&ccedil;as (SOF) do Hospital durante este per&iacute;odo, do qual me orgulho imensamente. A equipe de trabalho sempre foi respons&aacute;vel, din&acirc;mica e proativa, especialmente por conta da chefia do setor que sempre foi exemplo pessoal e profissional no ambiente de trabalho. A servidora Iara conduziu o SOF, e tenho certeza absoluta que ainda o faz, com extrema dedica&ccedil;&atilde;o e seriedade, demonstrando plena consci&ecirc;ncia de suas responsabilidades e orientando os servidores e bolsistas sobre a import&acirc;ncia do trabalho realizado pelo setor, em prol dos pacientes e da Institui&ccedil;&atilde;o. Fui testemunha de como a Iara nunca media esfor&ccedil;os, envolvida com as quest&otilde;es do trabalho do SOF inclusive nas f&eacute;rias e nos finais de semana, levando trabalho para casa, estudando e se atualizando, buscando resolver todas as pend&ecirc;ncias que surgiam, em um momento extremamente dif&iacute;cil, dadas as dificuldades financeiras e a escassez de recursos. Sempre firme em exigir um bom trabalho dos servidores e ao mesmo tempo atenciosa e pronta para ouvir os anseios dos mesmos, foi e &eacute; capaz de transmitir confian&ccedil;a e motiva&ccedil;&atilde;o a todos que trabalham com ela. Falo isso por experi&ecirc;ncia pr&oacute;pria e sei que todos tamb&eacute;m t&ecirc;m esse sentimento no SOF. Como funcion&aacute;ria do HUSM, n&atilde;o lembro de um momento sequer ter duvidado da compet&ecirc;ncia e integridade da Iara e at&eacute; hoje sinto profunda admira&ccedil;&atilde;o e respeito por ela. S&oacute; tenho a agradecer pelo tempo em que pude conviver com a Iara e por tudo que aprendi, pois poucas pessoas t&ecirc;m oportunidade, durante a vida, de ter como chefe uma pessoa t&atilde;o incr&iacute;vel e que agregue tanto na vida das pessoas ao seu redor... &ldquo; (Camila Kegler, servidora da C&acirc;mara de Vereadores)</p><hr><p style=\"\">3) &quot;Iara, &nbsp;Estou lhe enviando este e-mail para desejar um feliz e aben&ccedil;oado 2018. Desejo que voc&ecirc; continue sendo essa mulher lutadora, guerreira, trabalhadora, cheia de luz, alegre, muito competente e respons&aacute;vel. Quero que saibas que &eacute;s exemplo, pois o reconhecimento do teu trabalho vai al&eacute;m das portas do HUSM... Sim! Eu falo isso porque ouvi v&aacute;rias pessoas comentando muito bem do teu trabalho, da tua for&ccedil;a de vontade e iniciativa. E o SOF est&aacute; a&iacute; para mostrar, afinal organizaste um setor complexo da melhor forma poss&iacute;vel prezando pelo servi&ccedil;o p&uacute;blico e sempre buscando o melhor. <br>Eu posso dizer que tive o prazer de conhecer essa mulher especial, que tenho muito respeito, carinho e admira&ccedil;&atilde;o. Parab&eacute;ns pela maravilhosa pessoa que &eacute;s e principalmente por nunca ter esquecido os teus valores e princ&iacute;pios. Nunca vou esquecer das palavras de conforto num dos momentos mais fr&aacute;geis da minha vida, mesmo n&atilde;o estando perto fisicamente. <br>Iara, muito obrigada pela amizade, pelo ombro amigo, pelas palavras, mesmo sem v&ecirc;-la diariamente quero que saibas que mora em meu cora&ccedil;&atilde;o e sou muito grata por tudo. Continue essa profissional exemplar.<br>Saudades de quem te admira como profissional e como pessoa.<br>Grande beijo do fundo do cora&ccedil;&atilde;o&quot;. (Greice Pontelli, servidora da UFSM)</p><hr><p style=\"\">4) &quot;Iara,... fui dispensado de outro setor porque n&atilde;o consegui me adaptar a uma fun&ccedil;&atilde;o espec&iacute;fica que eu desempenhava ... ap&oacute;s um per&iacute;odo conturbado, acabei &quot;caindo de paraquedas&quot; aqui no SOF, onde (para minha surpresa!!) fui extremamente bem recebido por ti, Iara, e pelo &quot;Seu&quot; Paulo! O porqu&ecirc; da surpresa? Pelo motivo pelo qual eu estava chegando, acreditei que seria visto com maus olhos. Lembro das tuas primeiras palavras para mim: &quot;N&atilde;o me importa o motivo pelo qual tu est&aacute; aqui, o que importa &eacute; que tu est&aacute; aqui e tenho certeza de que vai me ajudar muito!&quot;. Aquilo, de chegada, j&aacute; me deu um &acirc;nimo para recome&ccedil;ar minha caminhada pelo HUSM!</p><p style=\"\">Nesse per&iacute;odo de aproximadamente quatro meses que estou no SOF, posso dizer: ainda bem que n&atilde;o me quiseram no outro setor!! Aqui me sinto muito mais feliz trabalhando, mais livre para opinar... O tempo foi passando e rapidamente foi se criando uma afinidade, amizade, fidelidade e uma confian&ccedil;a incr&iacute;vel na rela&ccedil;&atilde;o pessoal chefe-funcion&aacute;rio.... quero que tu saibas a pessoa maravilhosa que &eacute;s! Tu tens uma humildade fora do comum! &Eacute;s uma pessoa que trata seus funcion&aacute;rios com carinho, franqueza, sinceridade, cumplicidade e amizade, fazendo elogios quando merecido, &quot;brigando&quot; e corrigindo quando preciso e muitas vezes dando conselhos e exemplos - conselhos esses que me foram dados muitas vezes quando passei na tua sala para &quot;bater um papinho com a chefe&quot;.</p><p style=\"\">Adorei a equipe toda do SOF! &Eacute; claro que tive mais afinidade com os do lado or&ccedil;ament&aacute;rio, tanto que acabei criando um v&iacute;nculo com praticamente todos...&nbsp;</p><p style=\"\">... Para finalizar, j&aacute; que estou de sa&iacute;da para um projeto pessoal que estou colocando muita f&eacute; de que vai dar certo.... quero te agradecer muito mesmo pela for&ccedil;a.... Saio do Setor realizado pela experi&ecirc;ncia que foi curta, mas intensa e muito produtiva. Levo daqui amigos (espero que alguns para a vida toda) e uma chefe que foi mais uma m&atilde;ezona para mim. Enfim, mais uma vez muito obrigado por tudo.&quot; (Guilherme Silveira, empres&aacute;rio)</p><hr><p style=\"\">5) &nbsp;&ldquo;Iara, para uma pessoa muito especial... uma pequena recorda&ccedil;&atilde;o dos colegas e amigos do SOF: &nbsp;Impressionante s&atilde;o as palavras em cada uma das mensagens, parece que foram combinadas, uma esp&eacute;cie de c&oacute;pia e cola hehehe ... palavras que se repetem in&uacute;meras vezes, de agradecimento, generosidade, m&atilde;e, guerreira, admira&ccedil;&atilde;o e por a&iacute; vai... &nbsp;&ndash; Ser&aacute; que voc&ecirc; est&aacute; no caminho errado como pensa &agrave;s vezes? &ndash; Ser&aacute; que tantos pensamentos est&atilde;o errados? &ndash; Ser&aacute; poss&iacute;vel uma pessoa ser injusta com tantos elogios? N&atilde;o, Iara. Voc&ecirc; est&aacute;, sim, no caminho certo, e mais, cercada de pessoas que te adoram, que querem teu bem e est&atilde;o dispostas a te ajudar no que for preciso. Muito lindo de ver a dedica&ccedil;&atilde;o de cada um escrevendo.... &ldquo;ai meu Deus, o que escrevo...&rdquo;, &ldquo;preciso de mais tempo&rdquo;, &ldquo;n&atilde;o consigo escrever pouco sobre a Iara&rdquo;, &ldquo;s&oacute; quero ver a rea&ccedil;&atilde;o dela&rdquo;, &ldquo;iii a Iara vai chorar rios&rdquo;.... baixaram a cabe&ccedil;a e escreveram at&eacute; a &uacute;ltima linha do papel. Pessoa de sorte voc&ecirc;, n&atilde;o? Hehehe.... N&atilde;o. N&atilde;o &eacute; sorte, voc&ecirc; lutou muito e luta para ser o que &eacute;, chegar onde est&aacute;, fazer o que faz e com isso ganhar nossa admira&ccedil;&atilde;o, carinho e respeito. &Eacute;s merecedora. Esperamos que goste, &eacute; simples, mas de cora&ccedil;&atilde;o!&rdquo;&nbsp;</p><p style=\"\">&nbsp; &nbsp; &nbsp; &quot; Iara, ... continue sendo essa mulher de muita luz, for&ccedil;a e garra, inspirando a todos que possuem a <u>sorte&nbsp;</u>de conviver com essa exist&ecirc;ncia exuberante, cheia de luz. Todos do SOF lhe desejam muito sucesso, alegria e a sorte de tudo o que &eacute; bom! (Equipe SOF)</p><hr><p style=\"\">6) &ldquo;Iara, fiquei horas pensando em como te passar palavras, o tamanho da admira&ccedil;&atilde;o que tenho por ti, em como nesses dois anos juntos tu me ensinaste e me fizeste crescer como pessoa, mas percebi que n&atilde;o importa o que eu escreva, n&atilde;o vai ser o bastante para demonstrar a import&acirc;ncia que tu fizeste e faz na minha vida. Obrigada por tudo! Beijos, Pri&rdquo; (Priscila)</p><hr><p style=\"\">7) &ldquo;Iara, super chefe, primeiramente gostaria de dizer: Obrigada!! Talvez pare&ccedil;a pouco para outros, mas foi voc&ecirc; que me deu a primeira oportunidade de ter um emprego, mesmo eu n&atilde;o tendo nenhuma experi&ecirc;ncia. E voc&ecirc; mais do que ningu&eacute;m sabe da import&acirc;ncia de receber um pequeno sal&aacute;rio e comprar coisas que para outros parecem insignificantes, mas que nos fazem muita falta. Obrigada, do fundo do meu cora&ccedil;&atilde;o. Espero poder ficar o m&aacute;ximo de tempo poss&iacute;vel trabalhando com sua equipe maravilhosa. Voc&ecirc; &eacute; uma pessoa forte, determinada e &eacute;, com certeza, um exemplo a ser seguido. Adoro voc&ecirc;... Que voc&ecirc; tenha toda a felicidade do mundo....&quot; (Thaine)</p><hr><p style=\"\">8) &ldquo;Iara, agrade&ccedil;o a oportunidade que me deu de trabalho no SOF. Te admiro por ser uma mulher forte e honesta que conquistou tudo com muita garra e tem uma hist&oacute;ria muito bonita.&rdquo; (Leticia Schaurich)</p><hr><p style=\"\">9) &ldquo;Iara, te desejo os melhores e mais puros sentimentos nesse final de ano, que voc&ecirc; continue essa pessoa incr&iacute;vel, profissional, de bom cora&ccedil;&atilde;o com todos que est&atilde;o a sua volta. Obrigada por ter feito parte do meu 2016, pelos sentimentos, por cada sorriso e carinho. Beijos&rdquo; (Let&iacute;cia Vargas)</p><hr><p style=\"\">10) &ldquo;Iara, que nossa equipe continue por muitos anos prezando sempre pela amizade. Continue sendo esse grande exemplo para todos n&oacute;s!&rdquo; (Thiago Filipini)</p><hr><p style=\"\">11) &ldquo;Iara, s&atilde;o tantas as coisas que aprendi com voc&ecirc; no decorrer desse ano, tantas alegrias vividas, tantos momentos compartilhados que se torna dif&iacute;cil condens&aacute;-los em poucas palavras. Queria te dizer que tenho por voc&ecirc; tamanha admira&ccedil;&atilde;o, carinho e respeito pela mulher que &eacute;, pela profissional, pela amiga e pela grande figura de muita for&ccedil;a e f&eacute; que representa. Beijos de Luz&rdquo; (Larissa)</p><hr><p style=\"\">12) &ldquo;Iara, no natal desejamos sempre o melhor para pessoas a quem admiramos e tenha certeza que esse &eacute; o desejo de toda a sua equipe. Durante todo o ano fomos guiados por suas decis&otilde;es e nesse dia t&atilde;o bonito podemos te desejar somente muito amor, paz, harmonia e um bom descanso para se restabelecer de todos os desafios que surgiram ao longo do ano que est&aacute; terminando. Em 2017 estaremos todos aqui para, juntos, com sua vis&atilde;o s&aacute;bia, obter os melhores resultados novamente!&rdquo; (Alan Macedo)</p><hr><p style=\"\">13) &ldquo;Iara, n&atilde;o sou muito bom com palavras, mas preciso dizer que uma das melhores coisas de 2016 foi ter vindo trabalhar aqui, e encontrar &ldquo;chefes&rdquo; como tu e seu Paulo. &nbsp;Pelo pouco de tua hist&oacute;ria que eu conhe&ccedil;o e pelo que eu vejo de ti diariamente posso dizer que tenho sorte de ter vindo trabalhar em um setor com uma chefe guerreira e com um enorme cora&ccedil;&atilde;o como tu.&rdquo; (Thiago)</p><hr><p style=\"\">14) &ldquo;Iara, quando crescer, quero ser como voc&ecirc;!!!&rdquo; (Humberto de Farias)</p><hr><p style=\"\">15) &ldquo;Iara, vi no SOF uma oportunidade de crescimento profissional e pessoal. Agrade&ccedil;o pela oportunidade de fazer parte dessa equipe.&rdquo; (Milena)</p><hr><p style=\"\">16) &ldquo;Iara, foi um aprendizado e grande alegria ter estado contigo neste ano de 2016. Muito obrigado! Que voc&ecirc; e sua fam&iacute;lia sejam ricamente aben&ccedil;oados por Deus, hoje e sempre.&rdquo;</p><p style=\"\">&nbsp; &nbsp; &nbsp; &nbsp;&quot;... continue firme, sendo refer&ecirc;ncia de amor, carinho, amizade, compet&ecirc;ncia, efici&ecirc;ncia etc. Resumindo, uma pessoa linda que todos querem por perto...&quot;</p><p style=\"\">&nbsp;(Rodrigo Ribeiro)</p><hr><p style=\"\">17) &ldquo;Iara, continue sempre sendo essa chefe e pessoa maravilhosa que a senhora &eacute;. Obrigado por tudo.&rdquo; (Jeferson Pinho)</p><hr><p style=\"\">18) &ldquo;Iara, agrade&ccedil;o muito por me aguentar e ter paci&ecirc;ncia comigo! Sinto um carinho muito forte vindo de ti. E pode ter certeza que tenho por ti tamb&eacute;m! S&oacute; te desejo coisas boas e tor&ccedil;o que sempre tenha sucesso na tua vida!&rdquo; (Nat&aacute;lia)</p><hr><p style=\"\">19) &ldquo;Iara, agrade&ccedil;o a Deus todos os dias por ter sido escolhida para fazer parte da equipe do SOF e tamb&eacute;m por conviver com pessoas como voc&ecirc;, uma grande l&iacute;der, amiga e m&atilde;e com a qual aprendi muito nesses dois anos e tenho imensa admira&ccedil;&atilde;o e respeito, &eacute; visto nos teus olhos o amor que tens para com n&oacute;s e no que faz (e &eacute; rec&iacute;proco). Com uma hist&oacute;ria de vida nada f&aacute;cil, mas talvez fosse preciso passar para ent&atilde;o ser o que &eacute;s hoje, merecedora de todas as virtudes da vida, merece muito e n&atilde;o deixarei que ningu&eacute;m diga o contr&aacute;rio...&rdquo; (Lis Daine)</p><hr><p style=\"\">20) &ldquo;Iara, gostaria de dizer que para mim voc&ecirc; &eacute; um exemplo de persist&ecirc;ncia. Uma guerreira que lutou pelos seus sonhos e que n&atilde;o desistiu nunca. E que apesar de ter enfrentado muitas adversidades, n&atilde;o perdeu a do&ccedil;ura e n&atilde;o endureceu o pr&oacute;prio cora&ccedil;&atilde;o. Queria agradecer a voc&ecirc; pela oportunidade que me deu, trabalhar aqui tem sido enriquecedor; tamb&eacute;m queria agradecer por toda a ajuda que me deu, por todo o elogio e incentivo. Voc&ecirc; &eacute; admir&aacute;vel, tanto como chefe, quanto como ser humano. Desejo que todos os seus desejos sejam atendidos por Deus, e que ele esteja sempre com voc&ecirc; e voc&ecirc; com ele.&rdquo; (Bruna)</p><hr><p style=\"\">21) &ldquo;Iara, voc&ecirc; al&eacute;m de chefe &eacute; uma amiga quando precisamos e um exemplo de for&ccedil;a, integridade, honestidade e generosidade. Espero que sua vida seja cheia de alegria, amor e sa&uacute;de para que possa continuar nos liderando para grandes conquistas.&rdquo; (Paulo)</p><hr><p style=\"\">22) &ldquo;Iara, pensamos que nossa vida &eacute; como velas, ... , elas iluminam e com essa luz deixam marcas em nossas vidas, assim &eacute; voc&ecirc; Iara. &Eacute; sempre bom ter algu&eacute;m alegre ao nosso lado que transmita coisas boas e &eacute; voc&ecirc;. Obrigado pela dedica&ccedil;&atilde;o no que faz.&rdquo; (Taylor)</p><hr><p style=\"\">23) &ldquo;Iara, minha admira&ccedil;&atilde;o por voc&ecirc; &eacute; como a quantidade de pastinhas que precisamos no SOF: n&atilde;o tem fim! Quero te desejar um Feliz Natal e Ano Novo e obrigado por ser essa pessoa, acima de tudo, generosa. Um beijo.&rdquo; (Kau&atilde;)</p><hr><p style=\"\">24) &ldquo;Iara, ... muito obrigado pelos ensinamentos e o carinho emanados a minha pessoa. Sabes que pode contar sempre comigo como pessoa e como profissional. Com carinho, respeito e admira&ccedil;&atilde;o.&rdquo;&nbsp;</p><p style=\"\">&nbsp; &nbsp; &nbsp; &nbsp;&quot; ... Obrigado por compartilhar conosco a beleza da tua exist&ecirc;ncia . Beijo no teu cora&ccedil;&atilde;o.&quot;&nbsp;</p><p style=\"\">(Marcelo Justiniano)</p><hr><p style=\"\">25) &nbsp;&quot; Que Deus lhe aben&ccedil;oe todos os dias, conforte seu cora&ccedil;&atilde;o, lhe mostre o caminho e afaste tudo o que mau. Te admiro e gosto muito de ti, beiijos!! &quot; (Renata Nogueira)</p><hr><p style=\"\">26) &quot;Iara, continue sendo essa pessoa maravilhosa! &quot; (Carol)</p><hr><p style=\"\">27) &quot; Iara, que o patr&atilde;o velho l&aacute; de cima continue te aben&ccedil;oando e guiando teus passos no caminho do bem. Te deseja mais felicidades, mais sa&uacute;de e muito amor daqueles que te querem t&atilde;o bem. Continue essa mulher maravilhosa que conhe&ccedil;o h&aacute; pouco tempo mas j&aacute; admiro muito....!&quot; (Greice Costa)</p><hr><p style=\"\">28) &quot;Iara, muito sucesso na tua vida, pois tu merece muito por ser essa pessoa t&atilde;o incr&iacute;vel que eu tive, gra&ccedil;as a Deus, a honra de ter como chefe e em t&atilde;o pouco tempo j&aacute; se tornou uma m&atilde;ezona e amiga.&quot; (Guilherme)</p><hr><p style=\"\">29) &quot;... Eu n&atilde;o tenho palavras o suficiente para descrever o quanto me sinto feliz por conhecer voc&ecirc;. Como j&aacute; te disse, s&atilde;o dos pequenos gestos teus que meus dias se tornam melhores, sua presen&ccedil;a me traz paz. Voc&ecirc; tem luz por onde passa, iluminando a vida de todos e deixando muitas alegrias no cora&ccedil;&atilde;o de cada um. Sinto orgulho de voc&ecirc; pela mulher que &eacute;s e sei que Deus tamb&eacute;m....&quot; (Ritalaine)</p><p style=\"\"><br></p>'),
(47, 2, 'Anivers&aacute;rio Surpresa 2017', '2017-01-27', 1, '<h3 style=\"\">Anivers&aacute;rio Surpresa 2017</h3><p style=\"\">Carinho da minha equipe linda.... obrigada!!</p><p style=\"\">Iara</p><p style=\"\"><img class=\"fr-dib fr-draggable\" src=\"../uploads/ad69dcc5fa8a67477dda5710081cb53ff98d3943.jpg\" style=\"width: 300px;\"></p><p style=\"\"><img class=\"fr-dib fr-draggable\" src=\"../uploads/fee7f14152910e049602ee6a3f4c15b2819a7a9a.jpg\" style=\"width: 300px;\"></p><p style=\"\"><br></p><p style=\"\"><br></p>'),
(48, 2, 'Anivers&aacute;rio Surpresa 2018', '2018-01-19', 1, '<h3 style=\"\">Anivers&aacute;rio Surpresa 2018</h3><p style=\"\">Sem palavras para descrever.... Carinho... Ternura... Eternizados no meu cora&ccedil;&atilde;o.... Obrigada e que Deus aben&ccedil;oe a todos!!</p><p style=\"\">Iara</p><p style=\"\"><img class=\"fr-dib fr-draggable\" src=\"../uploads/c0194741fba000bff58b7aef201e08c15f9bf6c3.jpg\" style=\"width: 300px;\"></p><p style=\"\"><img class=\"fr-dib fr-draggable\" src=\"../uploads/0ef50061db7595669cf0d8782c76509c16b0e90c.jpg\" style=\"width: 300px;\"></p><p style=\"\"><img class=\"fr-dib fr-draggable\" src=\"../uploads/50634febc4b49c6980000f793b419419a5a06447.jpg\" style=\"width: 300px;\"></p>'),
(49, 8, 'A&ccedil;&atilde;o Social: Lar de Miriam 2016', '2016-10-12', 1, '<h3>A&ccedil;&atilde;o Social: Lar de Miriam 2016</h3><p>No dia da crian&ccedil;a, um carinho do SOF ....</p><p><img class=\"fr-dib fr-draggable\" src=\"../uploads/89f45667649d30ec2623bef99e2289612d3d51a6.jpg\" style=\"width: 450px;\"></p><p>Participe voc&ecirc; tamb&eacute;m! Telefone (55) 3221-3981 .</p>'),
(50, 4, 'Acesso para Empresas', '2018-04-02', 1, '<h3 style=\"\">Acesso para Empresas</h3><hr><p style=\"\">O Setor de Or&ccedil;amento e Finan&ccedil;as do HUSM disponibiliza uma p&aacute;gina para acesso de empresas externas como forma auxiliar de comuni&ccedil;&atilde;o. &nbsp;Para acessar, cada empresa deve ter um cadastro no site, que pode ser feita por ela mesma. &nbsp;O login deve ser OBRIGATORIAMENTE o CNPJ da empresa que pretende acessar o site e deve fornecer um e-mail para contato (esse e-mail servir&aacute; para recupera&ccedil;&atilde;o de senha e para primeiro acesso, nada de newsletter). Fornecidos esses dois dados e o nome da empresa, o usu&aacute;rio receber&aacute; um e-mail do SOF com a senha gerada para primeiro acesso. Voc&ecirc; pode conferir tudo isso no <a href=\"https://youtu.be/VrfPMdj3WxE\" target=\"_blank\">v&iacute;deo</a> explicativo para cadastro de empresas.</p><p style=\"\">Ap&oacute;s o e-mail recebido, basta acessar a p&aacute;gina de login do SOF atrav&eacute;s do <a href=\"https://sofhusm.net.br/lte/login.php\" target=\"_blank\">link.</a></p>');
